import React from "react"
class App extends Component{
    constructor(){
        super()
        this.state={
            name:"Ahmad"

        }
        this.Change=this.Change.bind(this)
    }
    Change(){
        this.setState({name:"Abdullah"})
        console.log(this.state.name)
    }
    render(){

        return(
<button onClick={this.Change}>Click Here</button>
        )
    }
}
export default App
